import React from "react";

import Header from "../Components/Header";
import SubPortfolioInfo from "../UI/SubPortfolioInfo";
import Footer from "../Components/Footer";

import "../fonts/fonts.css";
import classes from "./Compose.module.css";
import classes2 from "./Nespresso.module.css";

const JejuDrink = () => {
  return (
    <div
      style={{
        width: "100%",
        maxWidth: "1920px",
        margin: "0 auto",
        position: "relative",
      }}
    >
      <Header bgColor=" " titleColor="#ffffff" />

      <div
        className={classes2.subPageBanner}
        style={{
          background: "url(images/sub_jeju_info_banner.png)",
          width: "100%",
          height: "980px",
          margin: "0 auto",
        }}
      >
        <SubPortfolioInfo
          portfolioInfo="#fff"
          peroid="2021.09 ~ 2021.10"
          percent="100%"
          PS=""
          AI="true"
          XD=""
          HTML=""
          CSS=""
          JS=""
        />
      </div>

      <section
        className={classes2.subInfo}
        style={{ background: "#fff", height: "1470px" }}
      >
        <img
          src="images/jeju_info_box_1.png"
          style={{ margin: "0 auto" }}
          alt="제주"
        />
      </section>

      <Footer footerBottom="0" />
    </div>
  );
};

export default JejuDrink;
